import React, { Component } from 'react';
import './App.css';
import Login from './Login'
import Model from './utils/Model';
import Body from './Body';
import ItemList from './ItemList';

const FRUITS = [
  {name: 'Apple', description: 'Crisp, fresh, delicious', price: '$.99 / lb', image: 'apple.jpeg'},
  {name: 'Orange', description: 'Juicy, fresh, citrus', price: '$1.22 / lb', image: 'orange.jpeg'},
  {name: 'Banana', description: 'Sweet, fresh, ripe', price: '$.69 / lb', image: 'banana.jpeg'},
  {name: 'Strawberry', description: 'Flavorful, fresh, red', price: '$1.62 / lb', image: 'strawberry.jpeg'},
  {name: 'Kiwi', description: 'Green, fresh, exotic', price: '$2.21 / lb', image: 'kiwi.jpeg'},
  {name: 'Grapes', description: 'Sour, fresh, tasty', price: '$2.21 / lb', image: 'grape.jpeg'},
];

const INVENTORY = [
  {category: "Fruit", data: FRUITS}
]


class App extends Component {
  constructor(){
    super();

    this.state = {
      pageToShow: "home",
      showNav: false
    };

    this.navigateTo = this.navigateTo.bind(this);
    this.toggleNav = this.toggleNav.bind(this);
  }

  navigateTo(pageName) {
    this.setState ({
      pageToShow: pageName
    });
  }

  toggleNav() {
    console.log("Toggle Nav");
    this.setState ({
      showNav: !this.state.showNav
    });
  }

  render() {
    return (
      <div className={this.state.showNav ? "ShowNav" : "HideNav"}>
        <Header toggleNav = {this.toggleNav}/>
        <div className="Body">
          {this.state.pageToShow == "home" ? <Body /> : null} 
          {this.state.pageToShow == "fruit" ? <ItemList items={FRUITS} category="Fruits"/> : null}
          {this.state.pageToShow == "seafood" ? <ItemList items={FRUITS} category="Seafood"/> : null}
        </div>
        <Menu 
          navigateToFunction = {this.navigateTo}
          toggleNav = {this.toggleNav}
          showNav = {this.state.showNav}/>
      </div>
    );
  }
}

class Header extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="Header">
                <div className="Left">
                  <a className="Menu" onClick={this.props.toggleNav} />

                </div>
                <div className="Right">
                    <User />
                </div>
            </div>
        );
    }
}

class Menu extends Component {
    constructor(props) {
        super(props);

        this.handleNavigateTo = this.handleNavigateTo.bind(this);
    }

    handleNavigateTo (event) {
        this.props.navigateToFunction(event.target.getAttribute("data"));
        this.props.toggleNav();
    }

    render() {
        return (
            <div className= {this.props.showNav ? "RightNav Show" : "RightNav"} >
                <div className="Content">
                    <div className="Header">
                        <a 
                            className="BackArrow" 
                            onClick={this.props.toggleNav} />
                    </div>
                    <div className = "List">
                        <div className = "Item">
                            <a onClick={this.handleNavigateTo} data='home'> Home </a>
                        </div>
                        <div className = "Item">
                            <a onClick={this.handleNavigateTo} data='fruit'> Fruit </a>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

class User extends Component {
    constructor(props) {
        super(props);

        this.state = {
            clicked : false
        };
    }

    handleClick = () => {
        this.setState({
            clicked : true
        });
    }

    render() {
        return (
            <div>
                <a className="User" onClick={this.handleClick} />
                {this.state.clicked ? <Model content={<Login />} /> : null}
             </div>
        );
    }
}

export default App;
